import CarService from '../../services/CarService';

export {};

export interface Car {
    _id ?: string,
    id: number;
    brand: string;
    model: string;
    seats: number;
    category: string;
    horsepower: number;
    seatsCount: number;
    fuelType: string;
    price: number;
    link: string;
  }

const carDataTwo: Car[] = await CarService.getCars();

export default carDataTwo;
